&lt;p&gt;&lt;a href="http://www.flickr.com/photos/camillelacroix/5030375202/" title="In it for the Money"&gt;&lt;img src="http://farm5.static.flickr.com/4150/5030375202_22c1d60112_m.jpg" width="240" height="160" alt="In it for the Money" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Time to pay the rent... Don't be impressed it wasn't only 50 $ bank notes... I'm not that rich! But it is something that interested me, how in the US, people carry a lot of bank notes, how they count it very fast, a great technique... The fact that there are notes of 1$ makes the notion of money very different compared to France... And in France we use a lot our credit/debit cards to pay even for little amounts of money, so we  never have big wads like this in our pockets...&lt;br /&gt;
&lt;br /&gt;
Music : Supergrass - In It For the Money &lt;a href="http://www.youtube.com/watch?v=T9xwduPKgnc" rel="nofollow"&gt;www.youtube.com/watch?v=T9xwduPKgnc&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
